import ContentLoader from "react-content-loader"

const Skeleton = (props) => (
  <ContentLoader 
    speed={2}
    width={280}
    height={500}
    viewBox="0 0 280 500"
    backgroundColor="#f3f3f3"
    foregroundColor="#ecebeb"
    {...props}
  >
    <circle x="5" cx="125" cy="125" r="125" /> 
    <rect x="0" y="338" rx="15" ry="15" width="280" height="85" /> 
    <rect x="1" y="283" rx="21" ry="21" width="280" height="36" /> 
    <rect x="0" y="443" rx="11" ry="11" width="101" height="36" /> 
    <rect x="118" y="443" rx="23" ry="23" width="161" height="38" />
  </ContentLoader>
)

export default Skeleton
